<script>

var scores = [];


function addPerson(room, alias, offsetX, offsetY)
{
	var roomShapeId = "shape22068-65682";

	// TODO mapping
	if(room === "1010FL")
	{
	roomShapeId = "shape22068-65682";
	}
	else if (room === "1150FL")
	{
	roomShapeId = "shape22111-65783";
	}
	else if (room === "1030FL")
	{
	roomShapeId = "shape22047-65629";
	}
	else if (room === "1190FL")
	{
	roomShapeId = "shape22121-65810";
	}
	else if (room === "1130FL")
	{
	roomShapeId = "shape21983-65462";
	}
	else if (room === "1170FL")
	{
	roomShapeId = "shape21985-65468";
	}
	else if (room === "1110FL")
	{
	roomShapeId = "shape21992-65487";
	}
	else if (room === "1240FL")
	{
	roomShapeId = "shape22261-66170";
	}
	else if (room === "1340FL")
	{
	roomShapeId = "shape22007-65523";
	}
	else if (room === "1801")
	{
	roomShapeId = "shape22104-65768";
	}
	else if (room === "1815FL")
	{
	roomShapeId = "1815FLshape22254-66156";
	}

	var roomShape = document.getElementById(roomShapeId);
	var roomOffset = roomShape.getAttribute("transform").match("([\-0-9\.]+)[, ]+([\-0-9\.]+)");
	var centerOffsetX = roomShape.getElementsByTagName("*")[3].getAttribute("cx");
	var centerOffsetY = roomShape.getElementsByTagName("*")[3].getAttribute("cy");
	var peopleSvg = document.getElementById("people-layer");
	var group = document.createElementNS("http://www.w3.org/2000/svg", "g");
	group.setAttribute("transform", "translate(" + (parseFloat(roomOffset[1]) + parseFloat(centerOffsetX)) + "," + (parseFloat(roomOffset[2]) + parseFloat(centerOffsetY)) + ")");
	var person = document.createElementNS("http://www.w3.org/2000/svg", "circle");
	person.setAttribute("cx", offsetX);
	person.setAttribute("cy", offsetY);
	
	var fill = "#3300FF"
	var score = this.scores[alias];
	if(typeof score === "undefined" || score < 1)
	{
		score = "0";
	}
	else if(score < 2)
	{
		fill = "#ff0000";
	}
	else if(score < 3)
	{
		fill = "#ff3300";
	}
	else if(score < 4)
	{
		fill = "#ff6600";
	}
	else if(score < 5)
	{
		fill = "#ff9900";
	}
	else if(score < 6)
	{
		fill = "#ffcc00";
	}
	else if(score < 7)
	{
		fill = "#ffff00";
	}
	
	person.setAttribute("style", "stroke: black; opacity: 0.8; fill: " + fill);		
	person.setAttribute("r", "3");
	
	var personInfluence = document.createElementNS("http://www.w3.org/2000/svg", "circle");
	personInfluence.setAttribute("cx", offsetX);
	personInfluence.setAttribute("cy", offsetY);
	personInfluence.setAttribute("style", "stroke: none; opacity: 0.15; fill: " + fill);		
	personInfluence.setAttribute("r", "20");
	
	var personTitle = document.createElementNS("http://www.w3.org/2000/svg", "title");
	personTitle.innerHTML = alias;
	if(score > 0)
	{
		group.appendChild(personInfluence);
	}
	group.appendChild(person);
	group.appendChild(personTitle);
	peopleSvg.appendChild(group);

}

function render()
{

addPerson("1801", "cdockter", -16, -48);
addPerson("1801", "drwill", 15, -70);

}
